import React, { Component } from "react";
import { Col, Tag } from "antd";
import styled from 'styled-components';

const StyledTag = styled(Tag)`
  margin-bottom: 8px;
`;

export class MyTag extends Component {
  render() {
    return (
      <Col span={8}>
        <h4 style={{ marginBottom: 16 }}>Presets:</h4>
        <div>
          <StyledTag color="magenta">Programmer</StyledTag>
          {/* <StyledTag color="red">red</StyledTag> */}
          {/* <Tag color="volcano" style={{marginBottom: "8px"}}>volcano</Tag> */}
          <Tag color="orange">Student</Tag>
          {/* <Tag color="gold">gold</Tag> */}
          {/* <Tag color="lime">lime</Tag> */}
          <Tag color="green">Actor</Tag>
          {/* <Tag color="cyan">cyan</Tag> */}
          {/* <Tag color="blue">blue</Tag> */}
          {/* <Tag color="geekblue">geekblue</Tag> */}
          <Tag color="purple" visible="false">Musician</Tag>
        </div>
      </Col>
    );
  }
}

export default MyTag;
